import React from "react";
import { JobType } from "../redux/jobSlice";

const Job: React.FC<JobType> = (props: JobType) => {
  const createdData: any = new Date(props.createdAt);
  const updateData: any = new Date(props.updatedAt);

  const countDate = (created: any, updated: any) => {
    const createdData: any = new Date(created);
    const updateData: any = new Date(updated);
    const differInSecs: any = (createdData - updateData) / 1000;

    const days: any = differInSecs / 86400;
    return days;
  };

  return (
    <div className="container">
      <img className="image"></img>
      <div className="description-container">
        <h1>{props.title}</h1>
        <div className="details-container">
          <p>Departament name:</p>
          <p>{props.address}</p>
          <div className="data">{countDate(updateData, createdData)}</div>
        </div>
      </div>
    </div>
  );
};

export default Job;
